Throughout the previous chapters, we have already introduced the concept of entity and demonstrated its usage in various contexts. In Canyon, however, an entity holds an even more powerful meaning than what was presented before. Put simply, a Canyon Entity is a user-defined type , which is represented as a struct, and is annotated with a special procedural macro: use canyon_sql::macros::canyon_entity; #[canyon_entity]
pub struct League { #[primary_key] pub id: i32, pub ext_id: i64, pub slug: String, pub name: String, pub region: String, pub image_url: String
} This macro unlocks a set of new features for the type. These features include: Inform Canyon that it should handle everything in the program that relates to this type on the database; Track the type along with all the necessary metadata on a special register; Allow the user to configure an alternative table name and specify the schema in which the entity being pointed to resides; These features provide a wealth of functionalities that will be explored further in upcoming chapters.

