(back to top) The primary purpose of Canyon is to facilitate database querying and retrieval of data. Writing raw SQL statements every time data is needed can be tedious, error-prone, and challenging to debug. Therefore, Canyon provides a solution to make the developer's life easier by automatically generating the desired queries. As described in previous chapter, the macros #[canyon_entity] and #[primary_key] describe an entity and the primary key, respectively. In Canyon's common language, an entity represents a Rust type that models a real world object. It is a term used to refer to a type that maps against a database table. Canyon recognizes this and generate an implementation block with methods and associated functions to allow the type to communicate with the database. Consider the following Rust type declaration: #[canyon_entity]
pub struct League { #[primary_key] pub id: i32, pub ext_id: i64, pub slug: String, pub name: String, pub region: String, pub image_url: String
} This struct represents the data of a professional competitive league from the League of Legends MOBA obtained from the LolEsports API. Suppose there is a web application that requests this information. The first thing that can be done is store it in the database and then serve it to the main application. Which could be, for instance, a mobile front-end application. Methods will have to be implemented for saving, retrieving, and updating data... To accomplish these tasks, Canyon will support the development by reducing the extensive amount of Rust code required to perform such database operations.

