One of the most commonly used queries when working with databases. In summary, it is the same as saying: "Please, database, give me all the data that you have for this table, including all of the columns!" In Canyon, this method is available as an associated function for your defined type T. The type::find_all() method can be translated to a SQL query SELECT * FROM {table_name}, which will return a collection of Row instances. The retrieved Row collection will then be automatically mapped into a Vec<T>, where T is the same type of the object where type::find_all was called. #[derive(CanyonCrud, CanyonMapper)]
#[canyon_entity]
pub struct League { #[primary_key] pub id: i32, pub ext_id: i64, pub slug: String, pub name: String, pub region: String, pub image_url: String
} We can retrieve all rows of the league table with the following line: let leagues: Result<Vec<League>, _> = League::find_all().await;

