Now it is time to write data into the database. Canyon provides a convenient way to insert data directly from an instantiated object. Remember this? #[derive(CanyonCrud, CanyonMapper)]
#[canyon_entity]
pub struct League { #[primary_key] pub id: i32, pub ext_id: i64, pub slug: String, pub name: String, pub region: String, pub image_url: String
} Let's create a League instance: let mut lec: League = League { id: Default::default(), ext_id: 134524353253, slug: "LEC".to_string(), name: "League Europe Champions".to_string(), region: "EU West".to_string(), image_url: "https://lec.eu".to_string(),
}; Notice how the id is Default::default(). For the type i32, this just means 0. Now, with that value, we will call the following instruction: lec.insert().await; And that record is now inserted into the database! But note one thing: the lec instance was declared as mutable. Why? It is important to remember that the insert method from Canyon will automatically update the self.id field. The previous id was replaced by the newly generated ID after the insert. Thanks to it, the insert method is a really convenient method for writing data into the database. For example, a common scenario is when you make a call to an external service and parse the data into a new instance of your Rust type. With this you can insert it directly in a single expression!

