A common alternative to writing better and more maintainable code is to use the convention of "constructors" in Rust. Although there is no exact concept of constructors in the language, a convention has been established for creating new instances of a given type T. This convention is to write an associated function ::new(params) in the impl block for initializing objects of the given type. Through this approach, an initializer may be implemented as follows: impl League { // Notice how id is not included in the parameters pub fn new( ext_id: i64, slug: String, name: String, region: String, image_url: String ) -> Self { Self { id: Default::default(), ext_id: ext_id, slug: slug, name: name, region: region, image_url: image_url } }
} With this in mind, the previous example can be written and inserted into the database as follows: // Create new instance
let lec: League = League::new( 134524353253, "LEC".to_string(), "League Europe Champions".to_string(), "EU West".to_string(), image_url: "https://lec.eu".to_string()
); // Insert new instance into the database
lec.insert().await; The insert instruction returns a Result<(), Err> type. For simplicity, we are omiting handling results. For more information on the topic, see in The Official Book .

