In addition to allowing the insertion of individual entities, Canyon also enables users to insert multiple entities with a single operation. The multi-insert feature is implemented as an associated function rather than a method of the instantiated object. You can pass instances of your type as a reference to a raw Rust array, and then await the result. The values generated for fields declared as primary keys will then be assigned to the corresponding field of each instance. The syntax for the multi-insert feature is shown below: /// Demonstration on how to perform an insert of multiple items on a table
async fn _multi_insert_example() { // Create an instance let new_league = League { id: Default::default(), ext_id: 392489032, slug: "DKC".to_owned(), name: "Denmark Competitive".to_owned(), region: "Denmark".to_owned(), image_url: "https://www.an_url.com".to_owned() }; // Create a second instance let new_league2 = League { id: Default::default(), ext_id: 392489032, slug: "IreL".to_owned(), name: "Ireland ERL".to_owned(), region: "Ireland".to_owned(), image_url: "https://www.yet_another_url.com".to_owned() }; // Create a third instance let new_league3 = League { id: Default::default(), ext_id: 9687392489032, slug: "LEC".to_owned(), name: "League Europe Champions".to_owned(), region: "EU".to_owned(), image_url: "https://www.lag.com".to_owned() }; // Unused Result<T, E> // Insert all three instances in a single transaction League::insert_into( &[new_league, new_league2, new_league3] ).await;
} The insert_into instruction returns a result with an array of the updated values that were inserted.

